
""" shiftingLetters
We have a string S of lowercase letters, and an integer array shifts.

Call the shift of a letter, the next letter in the alphabet, (wrapping 
around so that 'z' becomes 'a'). 

For example, shift('a') = 'b', shift('t') = 'u', and shift('z') = 'a'.

Now for each shifts[i] = x, we want to shift the first i+1 letters of S, 
x times.

Return the final string after all such shifts to S are applied.

Example 1:

Input: S = "abc", shifts = [3,5,9]
Output: "rpl"
Explanation: 
We start with "abc".
After shifting the first 1 letters of S by 3, we have "dbc".
After shifting the first 2 letters of S by 5, we have "igc".
After shifting the first 3 letters of S by 9, we have "rpl", the answer.

Note:

    1 <= S.length = shifts.length <= 20000
    0 <= shifts[i] <= 10 ^ 9

"""

# saving answer to a list and then concatenating to string is faster than 
# saving it on a string directly (strange but true)
class Solution:
    def shiftingLetters(self, S, shifts):
        """
        :type S: str
        :type shifts: List[int]
        :rtype: str
        """
        dicAl = {1:'a', 2:'b', 3:'c', 4:'d', 5:'e', 6:'f', 7:'g', 8:'h'
        , 9:'i', 10:'j', 11:'k', 12:'l', 13:'m', 14:'n', 15:'o', 16:'p'
        , 17:'q', 18:'r', 19:'s', 20:'t', 21:'u', 22:'v', 23:'w', 24:'x'
        , 25:'y', 26:'z'}
        dicAl2 = {'a':1, 'b':2, 'c':3, 'd':4, 'e':5, 'f':6, 'g':7, 'h':8
        , 'i':9, 'j':10, 'k':11, 'l':12, 'm':13, 'n':14, 'o':15, 'p':16
        , 'q':17, 'r':18, 's':19, 't':20, 'u':21, 'v':22, 'w':23, 'x':24
        , 'y':25, 'z':26}
        sumS, res = 0, [0]*len(S)
        for i in range(len(S)-1, -1, -1):
            sumS += shifts[i]
            cur = dicAl2[S[i]] + sumS
            if cur > 26: cur = cur%26 if cur%26 != 0 else 26
            res[i] = dicAl[cur]
        return ''.join(res)


print(Solution().shiftingLetters('abc', [3,5,9])) #"rpl"
print(Solution().shiftingLetters("qoqpvw",[95,7,67,21,33,23])) #"cjeozt"
